import React from 'react';
import s from './Blogs.module.css';

function Blogs() {

    return (
        <div className={s.body}>
            <span id={s.header}>Blogs</span>
            <br />
            <span  id={s.description} >WITH LOVE FOR DEVELOPING COOL STUFF, I LOVE TO WRITE AND TEACH OTHERS WHAT I HAVE LEARNT.</span>
            <div className={s.cart}>
                <div></div>
                <span id={s.title}>
                    Why REACT is The Best?
                </span>
                <span >
                React is a JavaScript library for building the user interface. It is maintained by Facebook and a community of individual developers and companies.
                </span>
            </div>
        </div>
    );
}

export default Blogs;
